import React, { Component } from 'react';

class Keys extends Component {
    createKeys = () => {
        const keys = [];
        for (let i = 1; i < 10; i++) {
            keys.push(
                <button key={i}>{i}</button>
            );
        }
        return keys;
    }

    render() { 
        return (
            <div>
                {this.createKeys()}
                <button key={0}>0</button>
            </div>
        );
    }
}
 
export default Keys;
